def find_given_name(person, sentence):
    # Split the sentence into words
    words = sentence.split()

    # Initialize an empty list to store the given names
    given_names = []

    # Iterate over the words in the sentence
    for i in range(len(words)):
        # If a word is an exact match for the person, add the preceding given name (if any) to the list
        if words[i] == person:
            if i > 0 and words[i-1][0] != 'M': # Assumes given names do not start with 'M' (for 'Mrs.')
                given_names.append(words[i-1])

